class Solution:
    def minBridges(self, n: int, requests: List[List[int]]) -> int:
        from collections import defaultdict
        from heapq import heapify, heappop, heappush

        graph = defaultdict(list)

        for a, b in requests:
            graph[a].append(b)
            graph[b].append(a)

        visited = [False] * n

        def dfs(node):
            visited[node] = True

            for nei in graph[node]:
                if not visited[nei]:
                    dfs(nei)

        ans = 0

        while True:
            visited = [False] * n
            cnt = 0

            for i in range(n):
                if not visited[i]:
                    dfs(i)
                    cnt += 1

            if cnt == 1:
                break

            ans += 1

        return ans
